import logo from '../../logo.svg';
import './App.css';
import React from "react";
import Hosts from "../Hosts/hosts";
import BookingService from "../../repository/bookingRepository";

class App extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            hosts : []
        }
    }

    render() {
        return (
          <div>
            <Hosts hosts = {this.state.hosts}></Hosts>
          </div>
        );
    }

    loadHosts = () => {
        BookingService.fetchHosts()
            .then((data) => {
                this.setState({
                    hosts: data.data
                })
            })
    }

    componentDidMount() {
        this.loadHosts();
    }
}

export default App;
